  min-height: 3.3vw;
  display: flex;
  justify-content: center;
  align-items: center;
  background: #6FCF97;
  border: 1px solid rgba(255, 255, 255, 0.3);
  box-sizing: border-box;
  border-radius: 4px;
  font-style: normal;
  font-weight: 800;
  font-size: 1.4vw;
  line-height: 100%;
  text-align: center;
  text-transform: uppercase;
  color: #FFFFFF;
}
.fuel_main .fuel_center .fuel_pay.fuel_electro {
  background: #56CCF2;
}
.fuel_bg {
  width: calc(120vw);
  position: absolute;
  display: flex;
  justify-content: center;
  align-items: center;
  overflow: hidden;
}
.fuel_bg img {
  width: 100%;
  height: 100%;
  animation-name: fuel_rotation;
  animation-duration: 30s;
  animation-iteration-count: infinite;
  animation-timing-function: linear;
  overflow: hidden;
}
@keyframes fuel_rotation {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(359deg);
  }
}
@keyframes fuel_spin {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(359deg);
  }
}

